import User from '../models/User'

export const createUser = async (req, res) => {
    
    const {rut, name, lastName, email, phone} = req.body //FALTARIA tipoUser COMO VARIABLE A INGRESAR

    const newUser = new User({rut, name, lastName, email, phone});
    //COPIA DEL PRODUCTO QUE SE A GUADADO
    const userSaved = await newUser.save()

    //CODIGOS DE ESTADO, PARA DECIRLE AL NAVEGADOR LO QUE ESTA PASANDO
    res.status(201).json(userSaved) //201 DICE QUE UN NUEVO RECURSO SE A


    res.json('creating user')
}
export const getUsers = async (req, res) => {
    const users = await User.find();
    res.json(users)

}
export const getUserById = async (req, res) => {
    const user = await User.findById(req.params.userId);
    res.status(200).json(user)

}

export const updateUserById = async (req, res) => {
    const updateUser = await User.findByIdAndUpdate(req.params.userId, req.body,{
        new: true
    })
    res.status(200).json(updateUser)
}
export const deleteUserById = async (req, res) => {
    const {userId} = req.params;
    await User.findByIdAndDelete(userId);
    res.status(204).json();
}

